import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Hello, Welcome</h1>
        <p>Please find the assignment task, select or press each button to know more.</p>

        <div className="button-container">
          <button className="btn">Counter Component</button>
          <button className="btn">User Data Form</button>
          <button className="btn">Rich Text Editors</button>
          <button className="btn">Additional Features(optional)</button>

        </div>
      </header>
    </div>
  );
}

export default App;
